package model;

public class StavkePopisa {
	Integer id;
	String stanjePoPopisu;
	Integer kolicinaUKartici;
	Integer porNaManjak;
	Integer artikalID;
	Integer prometniDokID;
	public StavkePopisa() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Integer getId() {
		return id;
	}
	public void setId(Integer id) {
		this.id = id;
	}
	public String getStanjePoPopisu() {
		return stanjePoPopisu;
	}
	public void setStanjePoPopisu(String stanjePoPopisu) {
		this.stanjePoPopisu = stanjePoPopisu;
	}
	public Integer getKolicinaUKartici() {
		return kolicinaUKartici;
	}
	public void setKolicinaUKartici(Integer kolicinaUKartici) {
		this.kolicinaUKartici = kolicinaUKartici;
	}
	public Integer getPorNaManjak() {
		return porNaManjak;
	}
	public void setPorNaManjak(Integer porNaManjak) {
		this.porNaManjak = porNaManjak;
	}
	public Integer getArtikalID() {
		return artikalID;
	}
	public void setArtikalID(Integer artikalID) {
		this.artikalID = artikalID;
	}
	public Integer getPrometniDokID() {
		return prometniDokID;
	}
	public void setPrometniDokID(Integer prometniDokID) {
		this.prometniDokID = prometniDokID;
	}

}
